import React from "react";

function Home2() {
  return (
    <>
      <div className="home21">
        <h1>Now Digital Signage “Made easy”</h1>
        <pre>
          NOW Signage is the smart solution for managing your digital signage
          content across all screens. Our low-cost and user-friendly platform
          offers plug-and-play convenience, making it ideal for both indoor and
          outdoor signs. Whether you’re new to digital signage or an expert, Now
          Signage provides top-notch service that you can depend on. We
          prioritize your success, so you can focus on growing your business and
          serving your customers. Partner with us and experience the confidence
          that comes with our commitment to elevating your brand. Get started
          today!
        </pre>
      </div>
    </>
  );
}

export default Home2;
